    "gulf-of-mexico-regional-climatology-ncei-accession-0123320",nt"isopen": false,nt"url":
    null,nt"notes": "The Gulf of Mexico Regional Climatology is a set of objectively
    analyzed climatological fields of temperature, salinity, oxygen, phosphate, silicate,
    and nitrate at standard depth levels. Climatologies were calculated for annual,
    seasonal, and monthly time periods on a one-degree for all variables, and for temperature
    and salinity on a quarter-degree and tenth-degree latitude-longitude grid for annual
    and seasonal time periods and are based on approximately 278,626 temperature profiles
    and 102,916 salinity profiles spanning the years of 1864 to 2012. The climatology
    is a project developed at the National Oceanographic Data Center (USA).",nt"license_title":
